import { Segment, Button } from 'semantic-ui-react';




class ComponentToPrint extends React.Component 
{

  render() {
    return (

      <table>
      <thead>
        <th>column 1</th>
        <th>column 2</th>
        <th>column 3</th>
      </thead>
      <tbody>
        <tr>
          <td>data 1</td>
          <td>data 2</td>
          <td>data 3</td>
        </tr>
      </tbody>
    </table>



    );
  }
}




  const PdfQp:  React.FC<{affilie: IAffilie}> = ({affilie}) => {

    const componentRef = createRef();


  return (

    <Segment>
     <ReactToPrint
        trigger={() => <button>Print this out!</button>}
        content={():any => componentRef }
      />
    </Segment>



  );


};

export default observer(PdfQp);
